export class UsuarioModel {
    public id?: number;
    public nombre: string;
    public apellido: string;
    public correo: string;
    public fechaNacimiento: string;
    public telefono: string;
    public paisResidencia: string;
    public contacto: boolean;

    constructor(_id: number, _nombre: string, _apellido: string, _correo: string, _fechaNacimiento: string, _telefono: string, _paisResidencia: string, _contacto: boolean){
        this.id = _id;
        this.nombre = _nombre;
        this.apellido = _apellido;
        this.correo = _correo;
        this.fechaNacimiento = _fechaNacimiento;
        this.telefono = _telefono;
        this.paisResidencia = _paisResidencia;
        this.contacto =  _contacto;
    }
}
